import React from 'react';
import { useFonts } from 'expo-font';
import { StatusBar } from 'expo-status-bar';
import { View, Text, StyleSheet, Linking, TouchableOpacity, Image } from 'react-native';
import { Container, Touchable } from "./styles/StyleHome";
import Abacus from "./icons/fruit.svg";

function Home({ navigation }) {
    return (
        <View style={{alignItems: 'center', justifyConten: 'center'}}>
          <Abacus width="100" height="100"/>
          <Text> dejex </Text>
          </View>
        
    );
  };

  export default Home;
